import React, { useEffect, useState } from "react";
import { getAdminProperties, toggleProperty, deleteProperty, updateProperty } from "../api";

export default function AdminPanel() {
  const [properties, setProperties] = useState([]);
  const [loading, setLoading] = useState(true);
  const [editingProperty, setEditingProperty] = useState(null); // for editing

  useEffect(() => {
    fetchProperties();
  }, []);

  async function fetchProperties() {
    try {
      setLoading(true);
      const data = await getAdminProperties();
      setProperties(data);
    } catch (err) {
      console.error(err);
      alert("Failed to load properties: " + err.message);
    } finally {
      setLoading(false);
    }
  }

  async function handleToggle(id) {
    try {
      await toggleProperty(id);
      fetchProperties();
    } catch (err) {
      console.error(err);
      alert("Failed to toggle availability: " + err.message);
    }
  }

  async function handleDelete(id) {
    if (!window.confirm("Are you sure you want to delete this property?")) return;
    try {
      await deleteProperty(id);
      fetchProperties();
    } catch (err) {
      console.error(err);
      alert("Failed to delete property: " + err.message);
    }
  }

  async function handleEdit(e) {
    e.preventDefault();
    try {
      await updateProperty(editingProperty.id, editingProperty);
      setEditingProperty(null);
      fetchProperties();
    } catch (err) {
      console.error(err);
      alert("Failed to update property: " + err.message);
    }
  }

  if (loading) return <div>Loading admin properties...</div>;

  return (
    <div>
      <h2>Admin Panel - Manage Properties</h2>
      {properties.length === 0 ? (
        <p>No properties found.</p>
      ) : (
        <table border="1" cellPadding="6" style={{ marginTop: 10 }}>
          <thead>
            <tr>
              <th>Title</th>
              <th>City</th>
              <th>Type</th>
              <th>Price</th>
              <th>Available</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {properties.map((p) => (
              <tr key={p.id}>
                <td>{p.title}</td>
                <td>{p.city}</td>
                <td>{p.type}</td>
                <td>{p.price}</td>
                <td>{p.available ? "Yes" : "No"}</td>
                <td>
                  <button onClick={() => handleToggle(p.id)}>
                    {p.available ? "Mark Unavailable" : "Mark Available"}
                  </button>
                  <button onClick={() => setEditingProperty(p)}>Edit</button>
                  <button onClick={() => handleDelete(p.id)}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}

      {editingProperty && (
        <div style={{ marginTop: 20 }}>
          <h3>Edit Property</h3>
          <form onSubmit={handleEdit}>
            <input
              placeholder="Title"
              value={editingProperty.title}
              onChange={(e) =>
                setEditingProperty({ ...editingProperty, title: e.target.value })
              }
              required
            />
            <input
              placeholder="City"
              value={editingProperty.city}
              onChange={(e) =>
                setEditingProperty({ ...editingProperty, city: e.target.value })
              }
              required
            />
            <input
              placeholder="Type"
              value={editingProperty.type}
              onChange={(e) =>
                setEditingProperty({ ...editingProperty, type: e.target.value })
              }
              required
            />
            <input
              placeholder="Price"
              type="number"
              value={editingProperty.price}
              onChange={(e) =>
                setEditingProperty({ ...editingProperty, price: e.target.value })
              }
              required
            />
            <label>
              Available:
              <input
                type="checkbox"
                checked={editingProperty.available}
                onChange={(e) =>
                  setEditingProperty({ ...editingProperty, available: e.target.checked })
                }
              />
            </label>
            <button type="submit">Save</button>
            <button type="button" onClick={() => setEditingProperty(null)}>
              Cancel
            </button>
          </form>
        </div>
      )}
    </div>
  );
}
